    public static void main(String[] args) {
        int total = 0;
        final AtomicInteger find = new AtomicInteger();
        List<String> errorList = new ArrayList<>();
        final AtomicBoolean has = new AtomicBoolean();

        Map<String, Integer> map = new HashMap<>();
        Set<String> set = new HashSet<>();

        for (String url : urls) {
            has.set(false);
            InputStream inputStream = null;
            FileOutputStream fos = null;
            try {
                if (url.contains("preferences")) {
                    total++;
                    HttpURLConnection connection = (HttpURLConnection)new URL(url).openConnection();
                    connection.setRequestMethod("GET");
                    connection.setRequestProperty("Content-Type", "application/octet-stream");
                    connection.setDoOutput(true);
                    connection.setDoInput(true);
                    inputStream = connection.getInputStream();
                    GZIPInputStream zis = new GZIPInputStream(inputStream);

                    SAXParserFactory factory = SAXParserFactory.newInstance();
                    SAXParser parser = factory.newSAXParser();
                    XMLReader reader = parser.getXMLReader();
                    reader.setContentHandler(new DefaultHandler(){
                        @Override
                        public void startElement(String uri, String localName, String qName, Attributes attributes) throws SAXException {
                            super.startElement(uri, localName, qName, attributes);
                            if (attributes != null && "cloud_symbol_assoc_level".equals(attributes.getValue("name"))) {
                                find.incrementAndGet();
                                has.set(true);
                                String value = attributes.getValue("value");
                                if(map.containsKey(value)) {
                                    int pre = map.get(value);
                                    map.put(value, pre + 1);
                                } else {
                                    map.put(value, 1);
                                }
                            }
                        }

                        @Override
                        public void endElement(String uri, String localName, String qName) throws SAXException {
                            super.endElement(uri, localName, qName);
                        }

                        @Override
                        public void characters(char[] ch, int start, int length) throws SAXException {
                            super.characters(ch, start, length);
                        }
                    });
                    reader.parse(new InputSource(zis));

                    if (!has.get()) {
                        String[] parts = url.split("_");
                        for(int i = 0; i < parts.length; i ++) {
                            if(parts[i].startsWith("CN") && i >= 1) {
                                set.add(parts[i - 1]);
                            }
                        }
                    }

                    System.out.println("parse "+find);
//                    return;
                }
            } catch (IOException e) {
                e.printStackTrace();
            } catch (SAXException e) {
                e.printStackTrace();
                errorList.add(url);
            } catch (ParserConfigurationException e) {
                e.printStackTrace();
            } finally {
                if (inputStream != null) {
                    try {
                        inputStream.close();
                    } catch (IOException e) {
                        e.printStackTrace();
                    }
                }
                if (fos != null) {
                    try {
                        fos.close();
                    } catch (IOException e) {
                        e.printStackTrace();
                    }
                }
            }
        }
        System.out.println("total=="+total+"  find cloud_symbol_assoc_level=="+find+" detail===="+map+" error=="+errorList.size()+" set==="+set+" size=="+set.size());
    }
